import React, {useState} from 'react';
import {toast} from "react-toastify";

const AdminPage = () => {
    const [productName, setProductName] = useState('');
    const [category, setCategory] = useState('');
    const [price, setPrice] = useState('');
    const [imgUrl, setImgUrl] = useState('');
    const [quantity, setQuantity] = useState('');

    const updateBtn = () => {

    }

    function addProduct(e) {
        e.preventDefault();
        const product = {productName, category, price, imgUrl, quantity}
        console.log(product);
        fetch("http://localhost:8080/nexusHub/cart/add", {
            method: "POST",
            headers: {"Content-Type": "application/json"},
            body: JSON.stringify(product)
        }).then((response) => {
            if (response.ok) {
                console.log('Product added Successful');
                response.json().then(data => {
                    toast.success('Login Successful', {
                        position: "top-center",
                        draggable: true,
                        hideProgressBar: true
                    });
                })
            } else {
                console.error('Product adding Failed');
                toast.warn('Product could not be added', {
                        position: "top-center",
                        draggable: true,
                        hideProgressBar: true
                    }
                );
            }
        })
            .catch((error) => {
                console.error('Error:', error);
            });
    }

    return (
        <div>
            <button className="btn btn-primary" onClick={addProduct}>Add new product</button>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Category</th>
                        <th>Price</th>
                        <th>Quantity</th>
                        <th>Image</th>
                        <th>Update</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{productName}</td>
                        <td>{category}</td>
                        <td>{price}</td>
                        <td>{quantity}</td>
                        <td>{imgUrl}</td>
                        <td>{<button className="btn btn-primary">Update</button>}</td>
                        <td>{<button className="btn btn-warning">Delete</button>}</td>
                    </tr>
                </tbody>

                

            </table>
        </div>
    );
};

export default AdminPage;
